    basic1 = Product(seller_id=1, name="Rainforest Basics 20 Pack AAA High-Performance Alkaline Batteries, 10-Year Shelf Life, Easy to Open Value Pack", description = "IN THE BOX: 20-pack of 1.5 volt AA alkaline batteries for reliable performance across a wide range of devices\nDEVICE COMPATIBLE: Ideal battery for game controllers, toys, flashlights, digital cameras, clocks, and more\nDESIGNED TO LAST: 10-year leak-free shelf life; store for emergencies or use right away\nEASY USE & STORAGE: Ships in Certified Frustration-Free Packaging; easy to open and store extras for later use\nSINGLE USE: These batteries are NOT rechargeable; for rechargeable options, check out Rainforest Basics rechargeable batteries", category="Rainforest Basics", price="14.86", inventory=50)
