    automotive1 = Product(seller_id=5, name="Febreze Unstopables Car Odor-Fighting Car Freshener Vent Clip Fresh, .07 fl oz. Car Vent Clip, Pack of 3", description = "fights trapped car odors with an irresistible scent\nTransform your world with the airy laundry vibes of Unstopables Fresh... who has time to do actual laundry, anyways?\nfights stinks for up to 30 days by adding even more freshness with your car's air flow\nSimple to activate: Push the vent clip until you hear it click in\nAdjust the scent intensity from low to high and explore your bold side", category="Automotive", price="7.94", inventory=50)
    automotive2 = Product(seller_id=6, name="MOTOPOWER MP69033 Car OBD2 Scanner Code Reader Engine Fault Code Reader Scanner CAN Diagnostic Scan Tool for All OBD II Protocol Cars Since 1996, Yellow", description = "Multi-Functions - Practical Multi-Functions OBD2 code reader features built-in OBD2 DTC lookup library, which help you to determine the cause of the engine light, read code, erase code, view freeze frame, I/M ready, vehicle information, data flow, real-time curve, get vehicle speed information, calculate load value, engine coolant temperature, get engine speed.\nWide Capability - Supports 9 protocols compatible with most 1996 US-Based, 2000 EU-Based and Asian cars, and newer OBD II & CAN domestic or import vehicles. Supports 6 languages - English,German, Dutch, Spanish, French, Italian.\nLCD Display - Designed with a clear display LCD screen (128 x 64 pixels) - white backlight and contrast adjustment. No need any battery or charger, OBD reader gets the power directly from your vehicle through the OBDII Data Link Connector.", category="Automotive", price="25.00", inventory=50)
    automotive3 = Product(seller_id=7, name="C P CHANTPOWER Air Compressor Tire Inflator,12V DC Car Tire Pump with Digital Pressure Gauge, 150PSI with Car Power Adaptor, Auto Shut Off for Car Tires, Bicycles and Other Inflatables (1-Yellow)", description = "Strong Motor & Fast Inflation --- This portable air compressor for your car tire is capable of providing a maximum pressure of 150 psi and an airflow of 35L/Min. You can inflate a car tire from 0 to 35psi in just minutes./nLCD Display Screen & Auto Cut Off --- The 12V tire pump will stop at preset air pressure. It will also shut itself off before overheating. The digital display can measure tire pressure in KPA, PSI, BAR, KG/CM, and it's easy to read under poor light.\n12V Power Supply & Convenient Storage --- Equipped with 12V plug to meet your daily and car use, make sure you can use it wherever you want. Air hose can be wound around the underside of the tire pump, no need to worry about messy cords when using.\n", category="Automotive", price="29.99", inventory=50,)
    automotive4 = Product(seller_id=8, name="Upgraded Car Cup Holder Expander Adapter with Offset Adjustable Base, Compatible with Yeti 14/24/36/46oz Ramblers, Hydro Flasks 32/40oz", description = "FIT MOST 32 OUNCE - 40 OUNCE WIDE BOTTLES & MUGS: Car cup holder expander is big enough for oversized thermoses, it also can work with most popular brands bottles and mugs.\nEXPANDABLE BASE FOR DIAMETER, CAR CENTRE CONSOLE CUP HOLDER: Car cup holder adapter comes with a base that expands to fill the console cup holder to fit different vehicles, such as motorcycles, boats, trucks, RV's and golf-carts\nSECURES TIGHTLY WITHOUT TIPPING OR SPILLING: This car drink cup holder built with solid and thick plastic and the rubber tabs around the top of the cup holder hold the cup firmly in place without tipping or spilling when driving down the road.", category="Automotive", price="24.99", inventory=50)
    automotive5 = Product(seller_id=9, name="NEXPOW 2000A Peak 18000mAh Car Jump Starter with USB Quick Charge 3.0 (Up to 7.0L Gas or 6.5L Diesel Engine), 12V Portable Battery Starter, Battery Booster with Built-in LED Light", description = " With the same battery capacity, our new Quick Discharge Start Power jump starter has 3-5 times enhanced current compare to the old 2nd generation. At the same time, It could balance the temperature by reducing start-up the temperature by disruptive innovation of battery/assembly structure to keep a safe start.\nCar jump starter can jump start your vehicle (up to 7.5L gas or 6.5L diesel engine) up to 20 times with 2000-amp of peak current and heavy-duty clamps and cables. Also, our battery starter could start trucks, motorcycles, snowmobiles, ATV, UTV, lawnmowers, and yachts up in a few minutes, even in extreme temperatures\nSafe and easy to use car battery jump starter pack without the worry of incorrect connections or sparks. Particularly spark-proof, reverse polarity protection, over-current protection, high-temperature protection, over-load protection. Safely connect to any 12-volt automotive car battery. The specially designed indicator notifies you of incorrect use with an audible buzz and flashing lights.", category="Automotive", price="59.49", inventory=50,)
