    appliance1 = Product(seller_id=1, name="Hamilton Beach Dual Breakfast Sandwich Maker with Timer, Silver (25490A)", description = "Quick and easy: With 4 easy steps, this breakfast sandwich maker cooks your custom sandwich in just 5 minutes. Perfect for brunch or a quick, healthy meal on the go.\n2 is better than 1: Dual breakfast sandwich maker is great for kids, extra guests, or if you're extra hungry.\nCreate a custom sandwich: Whether you're looking for low carb or protein packed, our complimentary breakfast maker recipe book puts plenty of fun and delicious meals right at your fingertips. Eliminate the bread and these are great for Keto and Paleo diets too.\nGreat gift: Perfect gift for Christmas, birthdays, father's day, mother's day, graduation, back to school and more", category="Appliances", price="46.99", inventory=50,)
    appliance2 = Product(seller_id=2, name="George Foreman 2-Serving Classic Plate Electric Indoor Grill and Panini Press, Black, GRS040B", description = "2 Servings - Tight on countertop space? This grill is your answer. It fits two servings of your grilled favorites, and it's perfect for small apartments and couples.\nNew Space-Saving Design* - With a low profile and vertical storage capabilities, it's simple to fit the grill in small spaces on your countertop or in the cupboard.\nAdvanced George Tough Nonstick Coating - There's a lot to love about this nonstick coating. It's 3x more durable**, easy to clean, and removes the need for butter and oil.\nAdjustable Grilling Angle - Set the grill at an angle to remove excess fat during grilling, or put it flat for panini and other toasting tasks. The hinged grill legs are simple to adjust.", category="Appliances", price="29.99", inventory=50,)
